const initialState = {
  data6: {},
  count: 6,
};
function reducer(state = initialState, action) {
  console.log(state);
  if (action.type === "submit") {
    var index = "data" + state.count;
    return {
      ...state,
      [index]: action.value,
      count: state.count + 1,
    };
  }
  return state;
}
export default reducer;
